class Solution(object):
    def jump(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        i, j, steps = 0, 1, 0
        while j < len(nums):
            endj = min(nums[i] + i + 1, len(nums))
            while j < endj:
                if nums[j] + j > nums[i] + i: i = j
                j += 1
            steps += 1
        return steps

